import React from 'react'
import {BrowserRouter, Link} from 'react-router-dom'

export default function Navbar(){


function Navbar(){
  return(
  <nav>
    <div class="wrapper">
      <div class="logo"><BrowserRouter><Link to='\'>VectoRent</Link></BrowserRouter></div>
      <ul class="nav-links">
          <li><a href="#">Home</a></li>
          <li><a href="#">About</a></li>
          <li><a href="#">Community</a> </li>
          <li><a href="#">Login</a></li>
        </ul>
  </div>
</nav>
)
}

return(
  <div>
    <Navbar/>
  </div>
)
}
